import React, { Fragment } from "react";
import { ImgText, SplashImg, NextBtn } from "../Style";

export const Splash = () => {
  return (
    <Fragment>
      <SplashImg src="img/img_main.svg" />
      <SplashLayout>
        <ImgText>나만의 Todo List 만들기</ImgText>
        <NextBtn>사용해보기</NextBtn>
      </SplashLayout>
    </Fragment>
  );
};
